Running to remember our fallen:
As we press into Memorial Day weekend I am reminded of my good fortune. Those that know my story know that it is by an act of God that I came off the battlefield. I lost a lot of friends in Mogadishu and many more since. So this morning I ran (a very emotional run) to remember our fallen. I don’t run because of a love for running. I instead, run for all of my friends who have sacrificed and are no longer here for an opportunity to run. I am thankful to all who have sacrificed for this great Nation and live my life with gratitude never forgetting! With love and respect for all of our fallen ... cheers🥃🇺🇸 
